INSERT INTO `contents` (`id`, `main_title`, `main_title2`, `page_name`, `page_title`, `page_title2`, `photo`, `content`) VALUES
(5, 'Transmith Group ', 'Tracking', 'Tracking', 'Transmith Group ', 'Tracking Number', '', '<p>\r\n	Every time you start a shipping at Transmith Group, a tracking number is automatically assigned to your package. Tracking numbers are used by Transmith Group to identify and trace every package as it moves through the Transmith Group system to its destination. You can use the tracking number to locate and verify arrival of your package, as well as other details. The tracking number can also be given to other third parties as a proof that the package is being shipped (the Sender has released the package and Transmith Group is delivering it to the receiver, in other means).</p>\r\n'),
(8, '', '', 'Cargo Transport Service', 'CTS - CARGO TRANSPORT SERVICE', '', '111.jpg', '<p>\r\n	Transmith Group&nbsp; is a wholly owned subsidiary of Transmith Group&nbsp;. Since its beginnings, Transmith Group&nbsp;has grown to become the recognized leader in the domestic and international cargo shipping business.Transmith Group&nbsp; provides the highest quality international cargo transport services for our global customer base.Transmith Group&nbsp; has been involved in the domestic and overseas cargo transport business for more then 50 years by now and has become the recognized leader in the global cargo transport industry. In the international cargo shipping business, no name is as recognized and respected in the industry as that of Transmith Group&nbsp;.<br />\r\n	If you are shipping a cargo between Britain or Sweden and Europe mainland, Japan or Philippines to Asia mainland, cross continent between North or South America, Europe, Asia, Australia or Africa, our international cargo shipping fleet of Transmith Group&nbsp; approved overseas auto transport partners will get your cargo to its destination safely, professionally and in a timely manner. Whether you are shipping a car to Guam or Sweden, it&#39;s always done right when in the hands of Transmith Group&nbsp;.</p>\r\n<p>\r\n	&nbsp;</p>\r\n'),
(11, '', '', 'Guide', 'Guide', '', '', '<p>\r\n	It is very easy to use the SafeDeal service, just follow the steps below.<br />\r\n	<br />\r\n	<span style="color:#b22222;"><strong>Step 1: Terms and data requests</strong></span><br />\r\n	To use SafeDeal you need to register. No problem. Registration is easy and free!<br />\r\n	If you have already registered type in your e-mail address and password and enter your Transaction page.<br />\r\n	To buy and sell goods, click on &quot;New transaction&quot; and fill in the gaps.<br />\r\n	To see the state of a transaction in progress or to add new data in a particular transaction, click on the Identification Number which is shown on the list of your transactions.<br />\r\n	After both the Buyer and Seller have agreed on the terms of the transaction, we will ask the Buyer to pay SafeDeal<br />\r\n	<br />\r\n	<span style="color:#b22222;"><strong>Step 2: The Buyer pays SafeDeal &nbsp;</strong></span><br />\r\n	The Buyer can pay SafeDeal with a credit card, bill of exchange, banker&#39;s draft or bank transfer. The money taken by SafeDeal is transfered into a no interest account.<br />\r\n	To know our fee click here or visit our web page <a href="http://www.tranrun-cts.com/financial_faq">Financial FAQ</a><br />\r\n	<br />\r\n	<span style="color:#b22222;"><strong> Step 3: The Seller sends the goods &nbsp;</strong></span><br />\r\n	Once SafeDeal has received the payment, the Seller will be asked to send the goods to the Buyer. For security reasons we will never send in an e-mail information on the address where the goods are to be sent. All the information needed should be obtained by entering the appropriate transaction page.<br />\r\n	<br />\r\n	<span style="color:#b22222;"><strong>Step 4: The Buyer approves the purchase &nbsp;</strong></span><br />\r\n	After the goods are received, the Buyer has the Inspection Period to value the purchase*, thus if the purchase is approved of, informing SafeDeal to authorise the transaction.<br />\r\n	<br />\r\n	<span style="color:#b22222;"><strong>Step 5: The Seller is paid &nbsp;</strong></span><br />\r\n	SafeDeal pays the Seller. We would like to remind the Seller that the expenses of sending and receiving the money will be charged to the consignee. For information on bank&#39;s charges please visit our Financial Faq page or send us a mail .</p>\r\n<p>\r\n	<span style="color:#0000ff;"><strong>Payment Options &amp; Addresses</strong></span></p>\r\n<p>\r\n	<span style="color:#b22222;"><strong>Wire Transfers</strong></span><br />\r\n	<br />\r\n	Available for all transactions<br />\r\n	<br />\r\n	&nbsp;&nbsp;&nbsp; Wire transfers can be submitted with the help of your banking institution. Provide your bank with the information below to properly transfer your payment.<br />\r\n	&nbsp;&nbsp;&nbsp; Note: Please be advised that for international wires, your bank may require and charge you for the use of an intermediary bank. You should contact your bank and inquire about the possibility of any additional transfer fees.<br />\r\n	&nbsp;&nbsp;&nbsp; Funds must be sent to our account as a wire transfer and not as an account-to-account transfer.</p>\r\n<p>\r\n	<strong><span style="color:#b22222;">Credit Card &amp; PayPa</span>l</strong><br />\r\n	<br />\r\n	Available on a limited basis and only on US Dollar transactions<br />\r\n	<br />\r\n	&nbsp;&nbsp;&nbsp; We currently accept American Express, Master Card, Visa, and PayPal.<br />\r\n	&nbsp;&nbsp;&nbsp; PayPal payment is available when both Buyer and Seller are same country residents and merchandise can be shipped to a PayPal &quot;confirmed&quot; address.<br />\r\n	&nbsp;&nbsp;&nbsp; Credit card and PayPal payments are accepted only for Premier Service level, have a maximum allowable amount of $5,000.00, and are subject to approval.<br />\r\n	&nbsp;&nbsp;&nbsp; Credit card and PayPal are NOT available for Vehicle Transactions or Milestone Transactions. Additional restrictions apply.</p>\r\n<p>\r\n	<span style="color:#b22222;"><strong>Check or Money Order</strong></span><br />\r\n	<br />\r\n	Available on a limited basis and only on US Dollar transactions<br />\r\n	<br />\r\n	&nbsp;&nbsp;&nbsp; After selecting the check/money order option on your transaction, please send the payment to our address.<br />\r\n	&nbsp;&nbsp;&nbsp; Please make your check or money order payable to Internet Escrow Services and include the escrow transaction number with the payment.<br />\r\n	&nbsp;&nbsp;&nbsp; Money order and check payments are only accepted when drawn on a UK bank, have a limit of $2000, and are subject to a 10-day bank hold (with the exception of U.S. Postal money orders). Sorry, we do not accept checks drawn on a credit card.<br />\r\n	<br />\r\n	<strong>* Note:</strong><br />\r\n	If the Client is not satisfied with the goods, he/she can inform SafeDeal that the goods will be returned to the Seller. When the goods are returned, the Seller has, after receiving the goods, the Inspection Period to verify that the goods have been returned in their original condition. After the Seller has confirmed the receipt and that the condition of the goods are to his/her satisfaction, SafeDeal wll reimburse the Buyer minus the fee due.<br />\r\n	<br />\r\n	The Buyer has to inform SafeDeal of his/her decision within the Inspection Period. SafeDeal will make the payment to the Seller if the Buyer has not given any notification within that period of time.</p>\r\n'),
(3, '', '', 'About Transmith Group ', 'About', 'Transmith Group ', 'principal.jpg', '<p>\r\n	Transmith Group begins by treating each shipment as if it were our only one. When you call, we are there within 60 minutes to pick up your shipment - no matter what time of day or night. With guaranteed on-time delivery, we will move your shipment via the next available flight, charter or hand-carry service to make sure it gets where it needs to, when it needs to. This focus and this commitment is what makes Transmith Group the time-critical shipping specialists, meeting all your urgent delivery needs worldwide.<br />\r\n	Transmith Group offers you:<br />\r\n	- Global Reach: Transmith Group provides same day domestic shipping, as well as overnight shipping to most international destinations. Plus, our global network of offices and our dedicated staff give you access to personalized attention and hands-on monitoring for every step of the shipping process.<br />\r\n	- 24/7 Availability: Transmith Group is open around-the-clock, ready to pick up and deliver your shipments 24 hours a day, seven days a week, 365 days a year, including weekends and holidays.<br />\r\n	- Immediate Response: With Transmith Group , it often takes an hour or less for your shipments to be on their way.<br />\r\n	- Total Control: Our Web-based worldwide tracking systems enable us to closely monitor every shipment throughout its journey. With online access to these systems, you can also check progress in real-time, as well as run on-time reports and more.<br />\r\n	- Ongoing Communication: Transmith Group will always notify you and your recipients immediately of any delays or flight changes that may affect your shipments. We&#39;ll also detail the steps we are taking to ensure on-time delivery.<br />\r\n	- Automatic Proof of Delivery: You will receive confirmation on every shipment, so you&#39;ll always know that your crucial delivery has arrived as scheduled.<br />\r\n	<br />\r\n	<span style="color:#b22222;"><strong>History:</strong></span><br />\r\n	<br />\r\n	-Yesterday: Robert Davis founded Transmith Group in 2005 with one basic mission - to handle every unusual and out-of-the-ordinary shipping need with speed and efficiency, every day of the year. This mission has remained the cornerstone of the company over the last years, and as a result Transmith Group proves to become leader in the urgent transportation industry.<br />\r\n	-Today: Transmith Group is known for its global presence, personalized service and its unique ability to meet every deadline, every time - anywhere in the world. Robert Davis, who continues to serve as President of Quick, has realized his vision - providing critical shipping solutions to some 75% of Fortune 500 companies to meet a broad range of business needs.<br />\r\n	-Tomorrow: Transmith Group will continue meeting your impossible deadlines and setting new standards in the critical shipping industry. It is what our success has been based on to date, and we believe it is what has helped the scores of companies who turn to us for their time-sensitive shipping needs succeed as well.</p>\r\n'),
(7, '', '', 'Packaging Tips', 'Packaging', 'Tips', '222.jpg', '<p>\r\n	Some Shipping Do&#39;s &amp; Don&#39;ts..<br />\r\n	<br />\r\n	<span style="color:#b22222;"><strong>Do:</strong></span><br />\r\n	<br />\r\n	Double box your fragile shipments.<br />\r\n	When shipping fragile goods, the best way to ensure that they are not damaged in transit is to first box the goods, making sure to wrap them in bubble wrap and insulate with packing peanuts. Then, place that box in a slightly larger one and surround the smaller box with packing peanuts, giving the goods inside an extra two layers of cushioning.<br />\r\n	Clearly label the interior as well as the exterior box. If one of the boxes is ripped or damaged, this extra step will ensure that your goods still get to their destination.<br />\r\n	Clearly mark fragile items. You want to make it clear to anyone who may encounter your package that the goods inside are breakable.<br />\r\n	<br />\r\n	<span style="color:#b22222;"><strong>Don&#39;t:</strong></span><br />\r\n	<br />\r\n	DON&#39;T Ship a partially full box. Boxes are often stacked on top of one another. If your packaged box is not filled to capacity with packing peanuts, bubble wrap, or newspapers, you run the risk of it getting crushed by a heavier box.<br />\r\n	DON&#39;T Loosely pack non-breakables with breakable items. While the glass part of your antique lantern may be packed properly, the loosely packed metal base could bounce around the box and crush the glass.<br />\r\n	DON&#39;T Ship perishable items without having them properly packaged. There are strict rules to be followed for shipping perishable items. If you are unsure, ask one of our agents and he will assist you with packaging for your perishable items.</p>\r\n'),
(9, '', '', 'Home', 'RELIABLE SHIPPING', 'SOLUTIONS', '', '<p>\r\n	Available 24 hours a day, 365 days a year, Transmith Group has been meeting your urgent shipping needs around the globe faster than anyone else. We transport everything from critical parts to keep an assembly line running, to crucial time-sensitive documents. Our personalized service offers hands-on monitoring, web-based tracking and guaranteed on-time delivery for your most impossible deadlines. Transmith Group&#39;s specialists can deliver virtually any type of shipment you may have, anywhere in the world with speed and reliability. Our ever-expanding array of customized services means that Transmith Group has the shipping solution to meet all your needs.</p>\r\n<p>\r\n	We believe in protecting Buyers and Sellers equally</p>\r\n<p>\r\n	<span style="color:#b22222;"><strong>Buyers benefit</strong></span><br />\r\n	Transmith Group tracks the shipped merchandise and verifies it was delivered.<br />\r\n	The Seller isn&#39;t paid until the Buyer accepts the merchandise, or the inspection period expires.<br />\r\n	<br />\r\n	<span style="color:#b22222;"><strong>Sellers benefit</strong></span><br />\r\n	Transmith Group confirms when the Buyer receives merchandise.<br />\r\n	The Seller is authorized to ship only after Transmith Group verifies good funds.</p>\r\n<p>\r\n	<span style="color:#b22222;"><strong>Wave goodbye to worry</strong></span><br />\r\n	At Transmith Group, we know uncertainty doesn&#39;t feel good. You can rely on us to ensure your merchandise or payment is protected with every transaction. Every step in your transaction is verified with proven tracking and verification procedures.<br />\r\n	Not only that, we are a licensed and government regulated escrow service. This means we are audited regularly by multiple government bodies. So, you can be sure our protection process prevents Buyer and Seller fraud with each and every transaction.<br />\r\n	<br />\r\n	All payments by the Buyer are verified as &quot;good funds&quot; before the Seller is instructed to ship<br />\r\n	All shipments are tracked to ensure the Seller shipped and the Buyer received the merchandise<br />\r\n	If the merchandise is fraudulent, it gives the Buyer the chance to return the merchandise before payment is released to the Seller<br />\r\n	<br />\r\n	That&#39;s right - completing online transactions with Transmith Group is that simple, safe and secure. And whether you&#39;re a Buyer or Seller, the control is in your hands.<br />\r\n	<br />\r\n	Wherever your company operates, Transmith Group&nbsp; will make sure that your documents, consignments and business mail are delivered safely and on time using our integrated air and road networks. Our international operations are focused on the key areas of world trade in North and South America, Europe, Asia and Australia. <span style="font-size:12px;"><font face="Verdana">.</font></span></p>\r\n'),
(10, '', '', 'Garage', 'Vehicle', 'Escrow', 'garageimg.jpg', '<p>\r\n	People have been asking us to develop a system that completes their Internet buying experience and we believe we have. The marketplace for the sale of used cars this year will be close to 50 million units and approximately a third of these will be sold online. One of the limitations of purchasing a vehicle over the Internet is verifying the condition of the vehicle prior to arranging for payment or transport. You have to know that we DO NOT accept any vehicles to be shipped using our company without a thorough technical and legal inspection of the specific vehicle. We have certified dealers inspectors that will perform the inspection. The inspectors will also check the relevant paperwork meaning that the car will only be accepted to be shipped after the inspection results will show that the car has not been stolen, it is not damaged, it has no outstanding finance, lien or debt, it is ready to be registered in the country of destination. Both the seller and the buyer will be notified regarding the inspection results. If the vehicle has been accepted to be shipped, then you can be 100% sure that the vehicle is in great condition and the paperwork is in order and ready to be registered in your country. The Inspection report provides a comprehensive review of a vehicle&#39;s interior and exterior and is a valuable tool in making a buying decision.</p>\r\n<p>\r\n	<span style="color:#b22222;"><strong>Vehicle Escrow in 5 simple steps</strong></span><br />\r\n	<br />\r\n	<strong>1- The Buyer and Seller agree to terms.</strong><br />\r\n	After registering at Transmith Group, both parties agree to the terms of the transaction, which includes a description of the vehicle, sale price, number of days for the Buyer&#39;s inspection of the vehicle, and any shipping information. Additional services including title collection and lien holder payoff may be selected at this time.<br />\r\n	<br />\r\n	<strong>2- The Buyer pays Transmith Group.</strong><br />\r\n	The Buyer submits a payment by selecting wire transfer. Check or money order are also available on amounts $2000 and under. Transmith Group verifies the payment. Processing time varies by payment method.<br />\r\n	<br />\r\n	<strong>3- The Seller ships the vehicle to the Buyer.</strong><br />\r\n	Upon payment verification, the Seller is authorized to ship the vehicle and submit tracking information. Transmith Group verifies that the Buyer receives the vehicle.<br />\r\n	<br />\r\n	<strong>4- The Buyer inspects and accepts the vehicle.</strong><br />\r\n	The Buyer has a set number of days to inspect the vehicle and the option to accept or reject the vehicle.<br />\r\n	<span style="color:#0000ff;">What if the Buyer doesn&#39;t accept the vehicle?</span><br />\r\n	The Buyer has the Inspection Period (a length of time agreed to by both parties) to accept the items. If dissatisfied, the Buyer must return the item to the Seller. Once the Seller has received the item and confirmed that they are in satisfactory condition, Transmith Group will release the funds back to the Buyer.<br />\r\n	<br />\r\n	<strong>5- The Seller is paid by Transmith Group.</strong><br />\r\n	Transmith Group pays the Seller by check, ACH or wire transfer. The transaction is complete.</p>\r\n<p>\r\n	<span style="color:#b22222;"><strong>The benefits of Vehicle Escrow</strong></span><br />\r\n	Both Buyers and Sellers benefit from using Transmith Group as a neutral third party to monitor and transact the exchange of payment and vehicle.<br />\r\n	<br />\r\n	<span style="color:#b22222;"><strong>Peace of mind for vehicle Sellers</strong></span><br />\r\n	The Buyer sends the agreed upon payment to Transmith Group. After verifying funds, we alert the Seller to send the vehicle to the Buyer. Protected from fraudulent checks and money order scams, the Seller has peace of mind knowing funds are behind the Transmith Group shield.<br />\r\n	<br />\r\n	<strong><span style="color:#b22222;">Confidence for vehicle Buyers</span></strong><br />\r\n	We do not release the money to the Seller until the vehicle has been received and accepted by the Buyer. This provides online car buyers the opportunity to inspect the vehicle before sellers are paid.</p>\r\n'),
(12, '', '', 'Safedeal', 'Escrow Shipping Service', '(SafeDeal)', '', '<p>\r\n	Transmith Group also offers SafeDeal services for buyers and sellers around the world.<br />\r\n	<br />\r\n	What is SafeDeal ? If you have already bought goods over the Internet, you know what the potential risks are when buying from an unknown seller. If you sell goods in online auctions, on restricted web sites, private web pages, or through Internet newsgroups, you know that the online buyers want to use their credit cards. Whatever the case SafeDeal can help you. SafeDeal is an impartial third party, whose task is to facilitate the online buying and selling, guaranteeing security, reliance and convience for both parties.<br />\r\n	<br />\r\n	Transmith Group reduces the risks of fraud for those who are buying or selling over the Internet, when dealing with consumer-to-consumer, business-to-consumer or business-to-business transactions.<br />\r\n	<br />\r\n	For a more detailed account of how our service works visit our <a href="guide" target="_blank">Guide</a></p>\r\n<p>\r\n	<span style="color:#b22222;"><strong>General Merchandise Escrow in 5 simple steps</strong></span><br />\r\n	<br />\r\n	<strong>1- The Buyer and Seller agree to terms.</strong><br />\r\n	After registering at Transmith Group, both parties agree to the terms of the transaction, which includes a description of the item, sale price, number of days for the Buyer&#39;s inspection of the item, and any shipping information. Additional services including title collection and lien holder payoff may be selected at this time.<br />\r\n	<br />\r\n	<strong>2- The Buyer pays Transmith Group.</strong><br />\r\n	The Buyer submits a payment by selecting wire transfer. Check or money order are also available on amounts $2000 and under. Transmith Group verifies the payment. Processing time varies by payment method.<br />\r\n	<br />\r\n	<strong>3- The Seller ships the item to the Buyer.</strong><br />\r\n	Upon payment verification, the Seller is authorized to start the shipping and submit tracking information. Transmith Group verifies that the Buyer receives the item.<br />\r\n	<br />\r\n	<strong>4- The Buyer inspects and accepts the item.</strong><br />\r\n	The Buyer has a set number of days to inspect the item and the option to accept or reject it.<br />\r\n	<span style="color:#0000ff;">What if the Buyer doesn&#39;t accept the item?</span><br />\r\n	he Buyer has the Inspection Period (a length of time agreed to by both parties) to accept the items. If dissatisfied, the Buyer must return the item to the Seller. Once the Seller has received the item and confirmed that they are in satisfactory condition, Transmith Group will release the funds back to the Buyer.</p>\r\n<p>\r\n	<strong>5- The Seller is paid by Transmith Group.</strong><br />\r\n	Transmith Group pays the Seller by check, ACH or wire transfer. The transaction is complete.</p>\r\n<p>\r\n	<span style="color:#b22222;"><strong>The benefits of General Merchandise escrow with us</strong></span><br />\r\n	Both Buyers and Sellers benefit from using Transmith Group as a neutral third party to monitor and transact the exchange of payment and merchandise.<br />\r\n	<br />\r\n	<strong><span style="color:#b22222;">Peace of mind for Sellers</span></strong><br />\r\n	The Buyer sends the agreed upon payment to Transmith Group and then we alert the Seller to send the merchandise to the Buyer. Protected from fraudulent checks and money order scams, the Seller has peace of mind knowing funds are behind the Transmith Group shield. Transmith Group tracks the merchandise to confirm when it has been received by the Buyer and starts the inspection period.<br />\r\n	<br />\r\n	<strong><span style="color:#b22222;">Confidence for Buyers</span></strong><br />\r\n	We do not release the money to the Seller until the merchandise has been received and approved by the Buyer. This provides online buyers the same security that off-line buyers have.</p>\r\n<p>\r\n	<strong><span style="color:#b22222;">SafeDeal Partners</span></strong><br />\r\n	SafeDeal has become the recommended transaction settlement service of many of the top names in eCommerce, including eBay, GoDaddy, Cars.com, Autoscout.com, Amazon.com ,Moto.it and AutoTrader. We&#39;re always looking for new partners who are interested in taking advantage of our unique and trusted escrow service.</p>\r\n'),
(13, '', '', 'Support', 'Support', '', '', '<p align="center">\r\n	<font color="navy" face="Verdana" size="2"><b>Maintaining excellent standards of customer care. ISO9001 registered.</b></font></p>\r\n<p>\r\n	<font face="Verdana" size="2">Our 107 franchisees provide invaluable local knowledge and interest, with the high standards of customer service that you expect. Once you have called your local depot to arrange a collection, a driver will collect your parcel, document or package and enter the details into a handheld portable data terminal known as a Parcel Coder carried by every vehicle driver. On arrival at the collecting depot, details of the package arrives, the route label is printed and ready to be attached and tracking details logged onto the computer. Our automated central sorting hub currently handles over 500,000 parcels a night. It uses a unique barcode on your package to identify, track, label, move, sort and load completely automated - in a matter of minutes. From the hub our linehaul trucks will take your package to the appropriate depot through the night, for delivery by Transmith Group  LTD vehicle or to an airport for despatch to one of 220 Countries that we serve. </font><br />\r\n	<br />\r\n	<br />\r\n	<a href="ldd"><font color="navy" face="Verdana" size="2"><b><u>Letters And Documents Delivery Division (LDD)</u></b></font></a><br />\r\n	<br />\r\n	<a href="pdfd"><font color="navy" face="Verdana" size="2"><b><u>Parcel Delivery Division (PD)</u></b></font></a><br />\r\n	<br />\r\n	<a href="pdfd"><font color="navy" face="Verdana" size="2"><b><u>Freight Delivery Division (FD)</u></b></font></a><br />\r\n	<br />\r\n	<a href="ctsandmvr"><font color="navy" face="Verdana" size="2"><b><u>Cargo Transport Service (CTS)</u></b></font></a><br />\r\n	<br />\r\n	<a href="ctsandmvr"><font color="navy" face="Verdana" size="2"><b><u>Motor Vehicle Relocation (MVR)</u></b></font></a><br />\r\n	<br />\r\n	<a href="tracking"><font color="navy" face="Verdana" size="2"><b><u>Online Tracking</u></b></font></a><br />\r\n	<br />\r\n	<a href="tranrun_document"><font color="navy" face="Verdana" size="2"><b><u>Transmith Group  Documents</u></b></font></a><br />\r\n	<br />\r\n	<a href="packaging"><font color="navy" face="Verdana" size="2"><b><u>Packaging tips (click here for more info)</u></b></font></a><br />\r\n	<br />\r\n	<a href="timezones"><font color="navy" face="Verdana" size="2"><b><u>Timezones</u></b></font></a><br />\r\n	<br />\r\n	<a href="lbskilos_converter"><font color="navy" face="Verdana" size="2"><b><u>Troubles converting LBS to Kilos?<br />\r\n	Click here to use our &quot;LBS-Kilos Converter&quot; to convert LBS to Kilos</u></b></font></a><br />\r\n	<br />\r\n	<a href="about"><font color="navy" face="Verdana" size="2"><b><u>About Transmith Group </u></b></font></a><br />\r\n	<br />\r\n	<a href="contact"><font color="navy" face="Verdana" size="2"><b><u>Contact Transmith Group </u></b></font></a><br />\r\n	<br />\r\n	<br />\r\n	<font color="navy" face="Verdana" size="2"><b>Tracking - Frequently Asked Questions (FAQ&rsquo;s)</b></font><br />\r\n	<br />\r\n	<font color="navy" face="Verdana" size="2">How long will consignment details be available on the Internet?</font><br />\r\n	<font face="Verdana" size="2">Tracking information will be available for a minimum of 120 days.</font><br />\r\n	<br />\r\n	<font color="navy" face="Verdana" size="2">Will the </font><span style="color:#000080;"><span style="font-size: 12px;">Transmith Group</span></span><font color="navy" face="Verdana" size="2"> Internet tracking facility be available 24 hours a day, 7 days a week?</font><br />\r\n	<font face="Verdana" size="2">The internet system will be available each day for 24 hours.</font><br />\r\n	<br />\r\n	<font color="navy" face="Verdana" size="2"><b>General - Frequently Asked Questions (FAQ&rsquo;s)</b></font><br />\r\n	<br />\r\n	<font color="navy" face="Verdana" size="2">What are the minimum system requirements for the </font><span style="color:#000080;"><span style="font-size: 12px;">Transmith Group</span><font face="Verdana" size="2"> Internet Tracking system?</font></span><br />\r\n	<br />\r\n	<font face="Verdana" size="2">The minimum system requirements for the </font>Transmith Group<font face="Verdana" size="2"> Internet Tracking system:<br />\r\n	-An IBM Compatible or Mac Compatible with an Internet Connection.<br />\r\n	-An InternetReady Operating System (ie: Microsoft Windows &reg; 95, 98, NT, 2000, or XP operating systems; Mac OS &reg; 7.6.1 or higher on Apple Macintosh Compatible systems; any linux operating system version)<br />\r\n	Recommended browsers include Microsoft Internet Explorer &reg; versions 3.x and higher or Netscape &reg; Navigator versions 3.x and higher. Alternatively any browser that supports Graphics, JavaScript and Cookies.</font><br />\r\n	<br />\r\n	<font color="navy" face="Verdana" size="2">How do I optimise my browser to ensure correct usage of the </font><span style="color:#000080;">Transmith Group</span><font color="navy" face="Verdana" size="2"> Internet Tracking system?</font><br />\r\n	<font face="Verdana" size="2">Set your browser to support the following settings:<br />\r\n	-Enable JavaScript<br />\r\n	-Enable cookies<br />\r\n	-Enable Graphics</font></p>'),
(14, '', '', 'Letter And Document Delivery Division', 'Letter And Document Delivery Division', '(LDD)', '', '<p>\r\n	<font color="navy" face="verdana" size="2"><b><u>SPECIAL EXPRESS</u></b></font><br />\r\n	<br />\r\n	<font face="verdana" size="2">For the quickest possible worldwide delivery.<br />\r\n	Special Express offers a flexible, tailor-made solutions for urgent shipments that have to be picked up and delivered immediately. This service includes pick-up and delivery outside of normal business hours by arrangement, door-to-door service with personal delivery, customs clearance at destination and automatic confirmation of delivery. Guaranteed next-day delivery is available with Special Express for documents originating the same country as the consignee and it is available only for the North America and Europe regions for the moment.<br />\r\n	Each individual piece may weight up to 70 pounds with an overall shipment weigh limit of 500 pounds. </font><br />\r\n	&nbsp;</p>\r\n<table border="0" cellpadding="0" cellspacing="0" width="100%">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n				<font color="navy" face="verdana" size="2"><b><u>9:00 EXPRESS</u></b></font><br />\r\n				<br />\r\n				<font face="verdana" size="2">For guaranteed delivery before 9:00 a.m.<br />\r\n				9:00 Express guarantees delivery before 9:00 a.m., typically on the second business day after collection (next-day delivery available to some destinations). 9:00 Express is available for documents to major North America, Europe and Canada regions.<br />\r\n				Each individual piece can weigh up to 70 pounds with an overall shipment weight limit of 500 pounds. The service includes door-to-door service with automatic confirmation of delivery, and money back guarantee *if* we fail to deliver on time. </font></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<br />\r\n<br />\r\n<table border="0" cellpadding="0" cellspacing="0" width="100%">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n				<font color="navy" face="verdana" size="2"><b><u>12:00 EXPRESS</u></b></font><br />\r\n				<br />\r\n				<font face="verdana" size="2">For guaranteed delivery before 12:00 noon.<br />\r\n				12:00 Express guarantees delivery before 12:00 noon, typically on the second business day after collection. 12:00 Express is available for documents to major cities worldwide and also for parcels to major European cities.<br />\r\n				Each individual piece can weigh up to 70 pounds with an overall shipment weight limit of 500 pounds. The service includes free insurance for goods valued up to $500, automatic confirmation of delivery, and money back guarantee *if* we fail to deliver your shipment on time. </font></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<br />\r\n<br />\r\n<table border="0" cellpadding="0" cellspacing="0" width="100%">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n				<font color="navy" face="verdana" size="2"><b><u>GLOBAL EXPRESS</u></b></font><br />\r\n				<br />\r\n				<font face="verdana" size="2">For express delivery to almost any destination worldwide.<br />\r\n				Global Express is available for documents, parcels, and freight.<br />\r\n				Each individual piece may weigh up to 70 pounds; overall shipment weight is not limited. The service includes door-to-door delivery Monday to Friday during normal business hours, customs clearance at destination, and is available for both exports and imports.<br />\r\n				Global Express also offers a one-rate Global Express Letter with no page or weight restrictions for all non-dutiable shipments, such as documents. </font></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<br />\r\n<br />\r\n<table border="0" cellpadding="0" cellspacing="0" width="100%">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n				<font color="navy" face="verdana" size="2"><b><u>ECONOMY EXPRESS</u></b></font><br />\r\n				<br />\r\n				<font face="verdana" size="2">For guaranteed delivery from Northeastern USA to Europe within three to five days.<br />\r\n				Economy Express is the most economical delivery service for all your heavy parcels shipped from Northeastern USA to over 25 countries in Europe. Economy Express guarantees delivery within three to five days.<br />\r\n				The service includes door-to-door delivery Monday to Friday during normal business hours and customs clearance at destination. </font></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<br />\r\n<br />\r\n<table border="0" cellpadding="0" cellspacing="0" width="100%">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n				<font color="navy" face="verdana" size="2"><b><u>USA EXPRESS</u></b></font><br />\r\n				<br />\r\n				<font face="verdana" size="2">For next business day service within the USA.<br />\r\n				Next-day express delivery to all U.S. destinations *by noon*. Available for documents and packages, USA Express includes door to door service Monday to Friday during normal business hours. USA Express also offers a one-rate USA Express Letter with no commodity or weight restrictions to all U.S. destinations.<br />\r\n				* Surcharge applies for non-continental USA destinations. </font></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<br />\r\n<br />\r\n<table border="0" cellpadding="0" cellspacing="0" width="100%">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n				<font color="navy" face="verdana" size="2"><b><u>IMPORT SERVICE</u></b></font><br />\r\n				<br />\r\n				<font face="verdana" size="2">Import Service takes care of everything and gives you complete control over your inbound shipments. The service currently operates from over 50 countries around the world with more coming in the near future. Transmith Group  handles all customs issues to ensure that your shipment is delivered customs-cleared, and eliminates potential problems with languages, time zone differences and the high cost of international telecommunications. As all prices are in local currencies, difficulties arising from exchange rate conversions and fluctuations are removed. </font></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<p>\r\n	<br />\r\n	<font color="navy" face="verdana" size="2"><b><u>AIR FREIGHT</u></b></font><br />\r\n	<br />\r\n	<font face="verdana" size="2">This service combines the advantages of an express goods service with the performance of air freight. Operating door-to-door or door-to-airport, Transmith Group  air freight service can provide time-definite deliveries and considerable economy.<br />\r\n	* Certain restrictions apply. </font></p>\r\n'),
