ize="2"><b><u>12:00 EXPRESS</u></b></font><br />\r\n				<br />\r\n				<font face="verdana" size="2">For guaranteed delivery before 12:00 noon.<br />\r\n				12:00 Express guarantees delivery before 12:00 noon, typically on the second business day after collection. 12:00 Express is available for documents to major cities worldwide and also for parcels to major European cities.<br />\r\n				Each individual piece can weigh up to 70 pounds with an overall shipment weight limit of 500 pounds. The service includes free insurance for goods valued up to $500, automatic confirmation of delivery, and money back guarantee *if* we fail to deliver your shipment on time. </font></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<br />\r\n<br />\r\n<table border="0" cellpadding="0" cellspacing="0" width="100%">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n				<br />\r\n				<font color="navy" face="verdana" size="2"><b><u>GLOBAL EXPRESS</u></b></font><br />\r\n				<br />\r\n				<font face="verdana" size="2">For express delivery to almost any destination worldwide.<br />\r\n				Global Express is available for documents, parcels, and freight.<br />\r\n				Each individual piece may weigh up to 70 pounds; overall shipment weight is not limited. The service includes door-to-door delivery Monday to Friday during normal business hours, customs clearance at destination, and is available for both exports and imports.<br />\r\n				Global Express also offers a one-rate Global Express Letter with no page or weight restrictions for all non-dutiable shipments, such as documents. </font></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<br />\r\n<br />\r\n<table border="0" cellpadding="0" cellspacing="0" width="100%">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n				<br />\r\n				<font color="navy" face="verdana" size="2"><b><u>ECONOMY EXPRESS</u></b></font><br />\r\n				<br />\r\n				<font face="verdana" size="2">For guaranteed delivery from Northeastern USA to Europe within three to five days.<br />\r\n				Economy Express is the most economical delivery service for all your heavy parcels shipped from Northeastern USA to over 25 countries in Europe. Economy Express guarantees delivery within three to five days.<br />\r\n				The service includes door-to-door delivery Monday to Friday during normal business hours and customs clearance at destination. </font></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<br />\r\n<br />\r\n<table border="0" cellpadding="0" cellspacing="0" width="100%">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n				<br />\r\n				<font color="navy" face="verdana" size="2"><b><u>USA EXPRESS</u></b></font><br />\r\n				<br />\r\n				<font face="verdana" size="2">For next business day service within the USA.<br />\r\n				Next-day express delivery to all U.S. destinations *by noon*. Available for documents and packages, USA Express includes door to door service Monday to Friday during normal business hours. USA Express also offers a one-rate USA Express Letter with no commodity or weight restrictions to all U.S. destinations.<br />\r\n				* Surcharge applies for non-continental USA destinations. </font></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<br />\r\n<br />\r\n<table border="0" cellpadding="0" cellspacing="0" width="100%">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n				<br />\r\n				<font color="navy" face="verdana" size="2"><b><u>IMPORT SERVICE</u></b></font><br />\r\n				<br />\r\n				<font face="verdana" size="2">Import Service takes care of everything and gives you complete control over your inbound shipments. The service currently operates from over 50 countries around the world with more coming in the near future. Transmith Group  handles all customs issues to ensure that your shipment is delivered customs-cleared, and eliminates potential problems with languages, time zone differences and the high cost of international telecommunications. As all prices are in local currencies, difficulties arising from exchange rate conversions and fluctuations are removed. </font></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<p>\r\n	<br />\r\n	<br />\r\n	<br />\r\n	<font color="navy" face="verdana" size="2"><b><u>AIR FREIGHT</u></b></font><br />\r\n	<br />\r\n	<font face="verdana" size="2">This service combines the advantages of an express goods service with the performance of air freight. Operating door-to-door or door-to-airport, Transmith Group  air freight service can provide time-definite deliveries and considerable economy.<br />\r\n	* Certain restrictions apply. </font></p>\r\n'),
(16, '', '', 'Freight Delivery Division', 'Freight Delivery Division', '(FD)', '', '<p>\r\n	<font color="navy" face="verdana" size="2"><b><u>SPECIAL EXPRESS</u></b></font><br />\r\n	<br />\r\n	<font face="verdana" size="2">For the quickest possible worldwide delivery.<br />\r\n	Special Express offers a flexible, tailor-made solutions for urgent shipments that have to be picked up and delivered immediately. This service includes pick-up and delivery outside of normal business hours by arrangement, door-to-door service with personal delivery, customs clearance at destination and automatic confirmation of delivery. Guaranteed next-day delivery is available with Special Express for documents originating the same country as the consignee and it is available only for the North America and Europe regions for the moment.<br />\r\n	Each individual piece may weight up to 70 pounds with an overall shipment weigh limit of 500 pounds. </font><br />\r\n	&nbsp;</p>\r\n<table border="0" cellpadding="0" cellspacing="0" width="100%">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n				<br />\r\n				<font color="navy" face="verdana" size="2"><b><u>9:00 EXPRESS</u></b></font><br />\r\n				<br />\r\n				<font face="verdana" size="2">For guaranteed delivery before 9:00 a.m.<br />\r\n				9:00 Express guarantees delivery before 9:00 a.m., typically on the second business day after collection (next-day delivery available to some destinations). 9:00 Express is available for documents to major North America, Europe and Canada regions.<br />\r\n				Each individual piece can weigh up to 70 pounds with an overall shipment weight limit of 500 pounds. The service includes door-to-door service with automatic confirmation of delivery, and money back guarantee *if* we fail to deliver on time. </font></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<br />\r\n<br />\r\n<table border="0" cellpadding="0" cellspacing="0" width="100%">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n				<br />\r\n				<font color="navy" face="verdana" size="2"><b><u>12:00 EXPRESS</u></b></font><br />\r\n				<br />\r\n				<font face="verdana" size="2">For guaranteed delivery before 12:00 noon.<br />\r\n				12:00 Express guarantees delivery before 12:00 noon, typically on the second business day after collection. 12:00 Express is available for documents to major cities worldwide and also for parcels to major European cities.<br />\r\n				Each individual piece can weigh up to 70 pounds with an overall shipment weight limit of 500 pounds. The service includes free insurance for goods valued up to $500, automatic confirmation of delivery, and money back guarantee *if* we fail to deliver your shipment on time. </font></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<br />\r\n<br />\r\n<table border="0" cellpadding="0" cellspacing="0" width="100%">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n				<br />\r\n				<font color="navy" face="verdana" size="2"><b><u>GLOBAL EXPRESS</u></b></font><br />\r\n				<br />\r\n				<font face="verdana" size="2">For express delivery to almost any destination worldwide.<br />\r\n				Global Express is available for documents, parcels, and freight.<br />\r\n				Each individual piece may weigh up to 70 pounds; overall shipment weight is not limited. The service includes door-to-door delivery Monday to Friday during normal business hours, customs clearance at destination, and is available for both exports and imports.<br />\r\n				Global Express also offers a one-rate Global Express Letter with no page or weight restrictions for all non-dutiable shipments, such as documents. </font></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<br />\r\n<br />\r\n<table border="0" cellpadding="0" cellspacing="0" width="100%">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n				<br />\r\n				<font color="navy" face="verdana" size="2"><b><u>ECONOMY EXPRESS</u></b></font><br />\r\n				<br />\r\n				<font face="verdana" size="2">For guaranteed delivery from Northeastern USA to Europe within three to five days.<br />\r\n				Economy Express is the most economical delivery service for all your heavy parcels shipped from Northeastern USA to over 25 countries in Europe. Economy Express guarantees delivery within three to five days.<br />\r\n				The service includes door-to-door delivery Monday to Friday during normal business hours and customs clearance at destination. </font></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<br />\r\n<br />\r\n<table border="0" cellpadding="0" cellspacing="0" width="100%">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n				<br />\r\n				<font color="navy" face="verdana" size="2"><b><u>USA EXPRESS</u></b></font><br />\r\n				<br />\r\n				<font face="verdana" size="2">For next business day service within the USA.<br />\r\n				Next-day express delivery to all U.S. destinations *by noon*. Available for documents and packages, USA Express includes door to door service Monday to Friday during normal business hours. USA Express also offers a one-rate USA Express Letter with no commodity or weight restrictions to all U.S. destinations.<br />\r\n				* Surcharge applies for non-continental USA destinations. </font></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<br />\r\n<br />\r\n<table border="0" cellpadding="0" cellspacing="0" width="100%">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n				<br />\r\n				<font color="navy" face="verdana" size="2"><b><u>IMPORT SERVICE</u></b></font><br />\r\n				<br />\r\n				<font face="verdana" size="2">Import Service takes care of everything and gives you complete control over your inbound shipments. The service currently operates from over 50 countries around the world with more coming in the near future. Transmith Group handles all customs issues to ensure that your shipment is delivered customs-cleared, and eliminates potential problems with languages, time zone differences and the high cost of international telecommunications. As all prices are in local currencies, difficulties arising from exchange rate conversions and fluctuations are removed. </font></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<p>\r\n	<br />\r\n	<br />\r\n	<br />\r\n	<font color="navy" face="verdana" size="2"><b><u>AIR FREIGHT</u></b></font><br />\r\n	<br />\r\n	<font face="verdana" size="2">This service combines the advantages of an express goods service with the performance of air freight. Operating door-to-door or door-to-airport, Transmith Group air freight service can provide time-definite deliveries and considerable economy.<br />\r\n	* Certain restrictions apply. </font></p>\r\n');
INSERT INTO `contents` (`id`, `main_title`, `main_title2`, `page_name`, `page_title`, `page_title2`, `photo`, `content`) VALUES
(17, '', '', 'Cargo Transport Service', 'CTS - CARGO TRANSPORT SERVICE', '', 'cts.jpg', '<p>\r\n	<font color="navy" face="verdana" size="2"><b><u>CTS - CARGO TRANSPORT SERVICE</u></b></font><br />\r\n	<br />\r\n	<font face="verdana" size="2">International Cargo Transport Service Via Transmith Group.<br />\r\n	Transmith Group is a wholly owned subsidiary of Transmith Group Limited. Since its beginnings, Transmith Group as grown to become the recognized leader in the domestic and international cargo shipping business. Transmith Group provides the highest quality international cargo transport services for our global customer base.<br />\r\n	Transmith Group has been involved in the domestic and overseas cargo transport business for more then 50 years by now and has become the recognized leader in the global cargo transport industry. In the international cargo shipping business, no name is as recognized and respected in the industry as that of Transmith Group.<br />\r\n	If you are shipping a cargo between Britain or Sweden and Europe mainland, Japan or Philippines to Asia mainland, cross continent between North or South America, Europe, Asia, Australia or Africa, our international cargo shipping fleet of Transmith Group approved overseas auto transport partners will get your cargo to its destination safely, professionally and in a timely manner. Whether you are shipping a car to Guam or Sweden, it&#39;s always done right when in the hands of Transmith Group.</font></p>\r\n'),
(18, '', '', 'Motor Vehicle Relocation', 'MVR - MOTOR VEHICLE RELOCATION', '', 'mvr.jpg', '<p>\r\n	<font color="navy" face="verdana" size="2"><b><u>MVR - MOTOR VEHICLE RELOCATION</u></b></font><br />\r\n	<br />\r\n	<font face="verdana" size="2">International Motor Vehicle Transport Service Via Transmith Group.<br />\r\n	Moving can be a difficult time. Your possessions have to be packed. You have to worry about placing your kids in a new school, your dogs on a new carpet, or maybe you are more concerned about a new boss at a new job in an unfamiliar new city. With so much to deal with, car shipping shouldn&#39;t be a concern. That&#39;s why Transmith Group stands ready to relocate your vehicle where ever you need it, when you need it.<br />\r\n	Transmith Group is one of the largest and most recognized auto shipping companies around the world. For the past 50 years, Transmith Group has been delivering cars across the globe and back. Transmith Group possesses one of the largest, most advanced car shipping fleet in the industry. Car carriers of all sizes and types are available to meet your specific requirements. A multitude of options are available to meet your specific needs: you may wish to have your car delivered directly to your door or you may wish to pick your car up at one of over 31 terminal locations across Europe, 85 terminal locations across North America and 12 terminal locations across Asia. Most of our vehicles ship onboard an enclosed transport to ensure maximum protection for your vehicle during its journey.<br />\r\n	Technology moves almost as fast as Transmith Group does. Satellite tracking provided by Skyline Online Tracking Software allows all of Transmith Group customers to log on to the web site to get the exact location of their car transport vehicle en route.<br />\r\n	For the past 50 years, Transmith Group has been the auto transport company of choice. With the most experience in the industry and the highest quality trucks and training for its employees, Transmith Group will make your car shipping as simple and worry-free as is possible.<br />\r\n	We bet you will be as pleased about our MVR Division as you have been pleased about our Parcel Delivery Division.</font></p>\r\n'),
(19, '', '', 'Transmith Group Documents', 'Transmith Group Document', '', '', '<p>\r\n	<a name="top"></a></p>\r\n<center>\r\n	<a name="top"><font face="Verdana" size="2">Please verify the accuracy of the information printed on your<br />\r\n	shipping receipt after it is handled to you by the Transmith Group staff.<br />\r\n	<br />\r\n	This is a <b>SAMPLE</b> receipt that you will receive when you will send a package via Transmith Group:<br />\r\n	<font face="Verdana" size="1">(Note: The receipt might be slightly different, based on the type of shipping method you are using)</font></font></a></center>\r\n<br />\r\n<p align="center">\r\n	<img alt="Sample receipt" border="0" src="images/receipt_pickup_explained_s.gif" style="text-align:center;" /></p>\r\n<p>\r\n	<a name="top"><font face="Verdana" size="2"><font face="Verdana" size="2"><font color="red"><b>1</b></font> - Tracking number<br />\r\n	A tracking number is assigned to every package sent via Transmith Group. </font></font></a><font face="Verdana" size="2"><font face="Verdana" size="2"><a href="tracking">Click here</a> to track your package using the tracking number.<br />\r\n	<a href="#top"><font color="navy" size="1">Back to top..</font></a><br />\r\n	<br />\r\n	<font color="red"><b>2</b></font> - Shipper&#39;s refference<br />\r\n	This is your own reference code for billing purposes.<br />\r\n	<a href="#top"><font color="navy" size="1">Back to top..</font></a><br />\r\n	<br />\r\n	<font color="red"><b>3</b></font> - Transmith Group certification<br />\r\n	Every receipt must have a </font></font><font face="Verdana" size="2"><font face="Verdana" size="2">Transmith Group</font></font><font face="Verdana" size="2"><font face="Verdana" size="2"> certification in order to be valid.<br />\r\n	<a href="#top"><font color="navy" size="1">Back to top..</font></a><br />\r\n	<br />\r\n	<font color="red"><b>4</b></font> - Pick-up info - Agent<br />\r\n	To be filled out by </font></font><font face="Verdana" size="2"><font face="Verdana" size="2">Transmith Group</font></font><font face="Verdana" size="2"><font face="Verdana" size="2"> driver or agent picking up the package. The driver or agent will enter his agent number.<br />\r\n	<a href="#top"><font color="navy" size="1">Back to top..</font></a><br />\r\n	<br />\r\n	<font color="red"><b>5</b></font> - Pick-up info - Date<br />\r\n	To be filled out by </font></font><font face="Verdana" size="2"><font face="Verdana" size="2">Transmith Group</font></font><font face="Verdana" size="2"><font face="Verdana" size="2"> driver or agent picking up the package. The driver or agent will enter the date and time of pick up.<br />\r\n	<a href="#top"><font color="navy" size="1">Back to top..</font></a><br />\r\n	<br />\r\n	<font color="red"><b>6</b></font> - From:<br />\r\n	This is the pick up address field. Enter the complete adress of shipper.<br />\r\n	<a href="#top"><font color="navy" size="1">Back to top..</font></a><br />\r\n	<br />\r\n	<font color="red"><b>7</b></font> - Delivery info - Agent<br />\r\n	To be filled out by </font></font><font face="Verdana" size="2"><font face="Verdana" size="2">Transmith Group</font></font><font face="Verdana" size="2"><font face="Verdana" size="2"> driver or agent delivering the package. The driver or agent will enter his agent number.<br />\r\n	<a href="#top"><font color="navy" size="1">Back to top..</font></a><br />\r\n	<br />\r\n	<font color="red"><b>8</b></font> - Delivery info - Date<br />\r\n	To be filled out by </font></font><font face="Verdana" size="2"><font face="Verdana" size="2">Transmith Group</font></font><font face="Verdana" size="2"><font face="Verdana" size="2"> driver or agent delivering the package. The driver or agent will enter the date and time of delivery.<br />\r\n	<a href="#top"><font color="navy" size="1">Back to top..</font></a><br />\r\n	<br />\r\n	<font color="red"><b>9</b></font> - To:<br />\r\n	This is the delivery address field. Enter the complete adress of consignee.<br />\r\n	<a href="#top"><font color="navy" size="1">Back to top..</font></a><br />\r\n	<br />\r\n	<font color="red"><b>10</b></font> - Description/Comodity<br />\r\n	Enter a short description of what the consignment consists of.<br />\r\n	<a href="#top"><font color="navy" size="1">Back to top..</font></a><br />\r\n	<br />\r\n	<font color="red"><b>11</b></font> - Number of items<br />\r\n	Enter the number of pieces your consignment consists of.<br />\r\n	<a href="#top"><font color="navy" size="1">Back to top..</font></a><br />\r\n	<br />\r\n	<font color="red"><b>12</b></font> - Weight per item<br />\r\n	Enter the weight of one item.<br />\r\n	<a href="#top"><font color="navy" size="1">Back to top..</font></a><br />\r\n	<br />\r\n	<font color="red"><b>13</b></font> - Total weight<br />\r\n	Enter the total weight of your consignment.<br />\r\n	<a href="#top"><font color="navy" size="1">Back to top..</font></a><br />\r\n	<br />\r\n	<font color="red"><b>14</b></font> - Special instructions<br />\r\n	Enter any special instructions you have regarding your consignment.<br />\r\n	<a href="#top"><font color="navy" size="1">Back to top..</font></a><br />\r\n	<br />\r\n	<font color="red"><b>15</b></font> - Shipper&#39;s signature<br />\r\n	Enter signature of shipper.<br />\r\n	<a href="#top"><font color="navy" size="1">Back to top..</font></a><br />\r\n	<br />\r\n	<font color="red"><b>16</b></font> - Date &amp; Time<br />\r\n	Enter the date and time when the shipment is ready.<br />\r\n	<a href="#top"><font color="navy" size="1">Back to top..</font></a><br />\r\n	<br />\r\n	<font color="red"><b>17</b></font> - Consignee&#39;s Signature<br />\r\n	Consignee&#39;s signature is required at delivery.<br />\r\n	<a href="#top"><font color="navy" size="1">Back to top..</font></a><br />\r\n	<br />\r\n	<font color="red"><b>18</b></font> - Date &amp; Time:<br />\r\n	The date and time for proof of delivery purpose.<br />\r\n	<a href="#top"><font color="navy" size="1">Back to top..</font></a><br />\r\n	<br />\r\n	<font color="red"><b>19</b></font> - ID type<br />\r\n	The type of ID that the shipper submits.<br />\r\n	(Note: Please sign your name and submit a form of ID to the </font></font><font face="Verdana" size="2"><font face="Verdana" size="2">Transmith Group</font></font><font face="Verdana" size="2"><font face="Verdana" size="2"> driver of agent to comply with FAA regulations)<br />\r\n	<a href="#top"><font color="navy" size="1">Back to top..</font></a><br />\r\n	<br />\r\n	<font color="red"><b>20</b></font> - ID number<br />\r\n	The number of the ID that the shipper submits.<br />\r\n	(Note: Please sign your name and submit a form of ID to the </font></font><font face="Verdana" size="2"><font face="Verdana" size="2">Transmith Group</font></font><font face="Verdana" size="2"><font face="Verdana" size="2"> driver of agent to comply with FAA regulations)<br />\r\n	<a href="#top"><font color="navy" size="1">Back to top..</font></a><br />\r\n	<br />\r\n	<font color="red"><b>21</b></font> - Shipper&#39;s signature<br />\r\n	The signature of the shipper.<br />\r\n	(Note: Please sign your name and submit a form of ID to the </font></font><font face="Verdana" size="2"><font face="Verdana" size="2">Transmith Group</font></font><font face="Verdana" size="2"><font face="Verdana" size="2"> driver of agent to comply with FAA regulations)<br />\r\n	</font></font></p>\r\n<center>\r\n	<p>\r\n		<font face="Verdana" size="2"><font face="Verdana" size="2"><a href="#top"><font color="navy" size="1">Back to top..</font></a></font></font></p>\r\n</center>\r\n<p>\r\n	&nbsp;</p>\r\n'),
(20, '', '', 'Footer Content', 'International Cargo Transport Service Via', 'Transmith Group ', '', '<p>\r\n	Transmith Group is a wholly owned subsidiary of Transmith Group Limited. Since its beginnings, Transmith Group has grown to become the recognized leader in the domestic and international cargo shipping business. Transmith Group provides the highest quality international cargo transport services for our global customer base.Transmith Group has been involved in the domestic and overseas cargo transport business for more then 50 years by now and has become the recognized leader in the global cargo transport industry. In the international cargo shipping business, no name is as recognized and respected in the industry as that of Transmith Group. If you are shipping a cargo between Britain or Sweden and Europe mainland, Japan or Philippines to Asia mainland, cross continent between North or South America, Europe, Asia, Australia or Africa, our international cargo shipping fleet of Transmith Group approved overseas auto transport partners will get your cargo to its destination safely, professionally and in a timely manner. Whether you are shipping a car to Guam or Sweden, it&#39;s always done right when in the hands of Transmith Group.</p>\r\n');
