INSERT INTO `faq` (`id`, `faq_type`, `question`, `answer`, `post_date`) VALUES
(1, 'Question About General Use', 'What can I buy or sell using SafeDeal ?', '<p>\r\n	<strong><span style="color:#b22222;"><span style="font-size: 12px;">You can use the SafeDeal service for private property (that is durable, tangible, physical goods). You cannot use the SafeDeal service for: real estate (including multiproperty); arms; tickets or other documents that have an expiry date; registrations; intangible services or goods for which the consignment of cannot be verified independently by SafeDeal For more information, click <a href="http://www.tranrun-cts.com/terms">here</a>. </span></span></strong></p>\r\n', '2013-09-11'),
(2, 'Question About General Use', 'What is the Inspection Period ?', '<p>\r\n	<span style="color:#0000ff;"><span style="font-size: 12px;"><font face="Arial,Helvetica,Geneva,Swiss,SunSans-Regular"><b>The Inspection Period is the amount of time given to the Buyer (or Seller, if the goods are returned) to examine and value the goods received. The Inspection Period begins at 12:01 on the working day (Monday - Friday) after the goods have been received and continues for the number of working days agreed on by the Buyer and Seller. The Day the goods are received is established according to the consignment date indicated by the courier or the transport company.</b></font></span></span></p>\r\n', '2013-09-11'),
(3, 'Question About General Use', 'How does Transmith Group protect me?', '<p>\r\n	<span style="color:#0000ff;"><strong><span style="font-size: 12px;">With Transmith Group, every step in your transaction is verified with proven tracking and verification procedures.</span></strong></span></p>\r\n<p>\r\n	<span style="color:#0000ff;"><strong><span style="font-size: 12px;">How Buyers are protected:</span></strong></span></p>\r\n<ul>\r\n	<li>\r\n		<span style="color:#0000ff;"><strong><span style="font-size: 12px;">Transmith Group tracks and verifies delivery of the shipped merchandise.&nbsp;</span></strong></span></li>\r\n	<li>\r\n		<span style="color:#0000ff;"><strong><span style="font-size: 12px;">The Seller isn&#39;t paid until the Buyer accepts the merchandise, or the agreed upon inspection period expires.&nbsp;</span></strong></span></li>\r\n</ul>\r\n<p>\r\n	<span style="color:#0000ff;"><strong><span style="font-size: 12px;">How Sellers are protected:</span></strong></span></p>\r\n<ul>\r\n	<li>\r\n		<span style="color:#0000ff;"><strong><span style="font-size: 12px;">Transmith Group verifies delivery of merchandise to the Buyer via the online trackable shipping that the Seller provides to Transmith Group.&nbsp;</span></strong></span></li>\r\n	<li>\r\n		<span style="color:#0000ff;"><strong><span style="font-size: 12px;">The Seller start the shipping after Transmith Group verifies good funds.</span></strong></span></li>\r\n</ul>\r\n<p style="clear: both; padding-bottom: 2em;">\r\n	&nbsp;</p>\r\n', '2013-09-11'),
(4, 'Question About General Use', 'Are international purchases and sales allowed?', '<p style="clear: both; padding-bottom: 2em;">\r\n	<span style="color:#0000ff;"><span style="font-size: 12px;"><b><font face="Arial,Helvetica,Geneva,Swiss,SunSans-Regular">Yes, we accept international transactions. Payment to SafeDeal, either by cheques or wire transfer, must be made in Euro, USD or GBP, payments made by credit card can only be accepted in Euro, you can calculate the cost of your transaction in your currency by using the </font></b></span></span><span style="color:#0000ff;"><span style="font-size: 12px;"><b><font face="Arial,Helvetica,Geneva,Swiss,SunSans-Regular">Currency Converter. Payment to the Seller will be made by SafeDeal with a cheque or bank transfer in the currency chosen and agreed on as in the details of the transaction.<span class="Apple-converted-space">&nbsp;</span></font><font face="Arial,Helvetica,Geneva,Swiss,SunSans-Regular">The expenses of sending and receiving the money will be charged to the consignee.</font><span class="Apple-converted-space">&nbsp;</span><font face="Arial,Helvetica,Geneva,Swiss,SunSans-Regular">The Buyer and Seller are responsible for all the import/export duties, customs, toll and taxes applied to international transactions.</font></b></span></span></p>\r\n', '2013-09-11'),
(5, 'Question About General Use', 'When should I use Transmith Group?', '<p style="clear: both; padding-bottom: 2em;">\r\n	<span style="color:#b22222;"><strong>The services offered through Transmith Group support most online transactions. It&#39;s ideal for exchanging higher-end items (above $500 in value) that merit the security and peace of mind that Transmith Group delivers. Typically, our customers use our service when the Buyer and Seller are unknown to each other, for purchases made on auction sites, classified ad sites, business-to-business e-commerce sites, and online merchants.<font face="Arial,Helvetica,Geneva,Swiss,SunSans-Regular" size="2"> </font></strong></span><br />\r\n	&nbsp;</p>\r\n', '2013-09-11'),
(6, 'Financial Question', 'How much does it cost to use the SafeDeal service?', '<p>\r\n	<span style="color:#b22222;"><strong><span style="font-size: 12px;">The cost of the SafeDeal service is based on the total amount of the transaction and on the method of payment used by the Buyer, as shown in the chart bellow. The total amount of the transaction is determined by the purchasing price of the goods plus the eventual postage and packing costs.</span></strong></span></p>\r\n<p>\r\n	&nbsp;</p>\r\n<table border="1" cellpadding="0" cellspacing="0" width="100%">\r\n	<tbody>\r\n		<tr height="30">\r\n			<td align="center" bgcolor="#336699" height="30" valign="middle" width="38%">\r\n				<b><font class="Apple-style-span" size="4"><font class="Apple-style-span" color="#000066" face="Arial" size="3"><b><b><font color="white" face="Arial,Helvetica,Geneva,Swiss,SunSans-Regular" size="2"><b>The transaction cost</b> </font> </b></b></font></font></b></td>\r\n			<td align="center" bgcolor="#336699" height="30" valign="middle" width="32%">\r\n				<b><font class="Apple-style-span" size="4"><font class="Apple-style-span" color="#000066" face="Arial" size="3"><b><b><font color="white" face="Arial,Helvetica,Geneva,Swiss,SunSans-Regular" size="2"><b>SafeDeal (Credit Card)</b> </font> </b></b></font></font></b></td>\r\n			<td align="center" bgcolor="#336699" height="30" valign="middle" width="14%">\r\n				<b><font class="Apple-style-span" size="4"><font class="Apple-style-span" color="#000066" face="Arial" size="3"><b><b><b><font color="#FFFFFF" face="Arial,Helvetica,Geneva,Swiss,SunSans-Regular" size="2">bank transfer</font> </b> </b></b></font></font></b></td>\r\n			<td align="center" bgcolor="#336699" height="30" valign="middle" width="16%">\r\n				<p style="word-spacing: 0px; margin-top: 0px; margin-bottom: 0px; ">\r\n					<b><font class="Apple-style-span" size="4"><font class="Apple-style-span" color="#000066" face="Arial" size="3"><b><b><font color="#FFFFFF"><b><font face="Arial,He