a,Swiss,SunSans-Regular" size="2">GBP 2.75</font> </b> </b></b></font></font></b></p>\r\n			</td>\r\n			<td height="24" valign="middle" width="16%">\r\n				<p align="center" style="word-spacing: 0px; margin-top: 0px; margin-bottom: 0px; ">\r\n					<b><font class="Apple-style-span" size="4"><font class="Apple-style-span" color="#000066" face="Arial" size="3"><b><b><b><font color="#CC0000" face="Arial,Helvetica,Geneva,Swiss,SunSans-Regular" size="2">Euro 4.00</font> </b> </b></b></font></font></b></p>\r\n				<p align="center" style="word-spacing: 0px; margin-top: 0px; margin-bottom: 0px; ">\r\n					<b><font class="Apple-style-span" size="4"><font class="Apple-style-span" color="#000066" face="Arial" size="3"><b><b><b><font color="#0000FF" face="Arial,Helvetica,Geneva,Swiss,SunSans-Regular" size="2">USD 4.00</font> </b> </b></b></font></font></b></p>\r\n				<p align="center" style="word-spacing: 0px; margin-top: 0px; margin-bottom: 0px; ">\r\n					<b><font class="Apple-style-span" size="4"><font class="Apple-style-span" color="#000066" face="Arial" size="3"><b><b><b><font color="#000066" face="Arial,Helvetica,Geneva,Swiss,SunSans-Regular" size="2">GBP 2.75</font> </b> </b></b></font></font></b></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<p style="word-spacing: 0px; margin-top: 0px; margin-bottom: 0px; ">\r\n	&nbsp;</p>\r\n', '2013-09-11'),
(7, 'Financial Question', 'How does Transmith Group protect against fraud?', '<p>\r\n	<span style="color:#0000ff;"><span style="font-size: 12px;"><strong>Transmith Group takes several steps to protect both the Buyer and Seller against fraud: 1) all payments by the Buyer are verified as &quot;good funds&quot; before the company&nbsp; starts the shipping; 2) all shipments are tracked to ensure the Seller shipped and the Buyer received the merchandise; and 3) if the merchandise is fraudulent, it gives the Buyer the chance to return it to the Seller without funds being released.</strong></span></span></p>\r\n', '2013-09-11'),
(8, 'Financial Question', 'Who pays SafeDeal service fees?', '<p>\r\n	<span style="color:#b22222;"><strong><span style="font-size: 12px;">The cost of the service can be paid by the Buyer, the Seller, or divided between them both. The Buyer and the Seller will come to an agreement, at the beginning of the transaction proceedings, on who will pay for the service. The Buyer is responsible for the payment when the goods are returned, without considering the person who had taken on the responsibility of the payment at the beginning of the transaction.</span></strong></span></p>\r\n', '2013-09-11'),
(9, 'Financial Question', 'When do I pay?', '<p>\r\n	<span style="color:#b22222;"><span style="font-size: 12px;"><strong>The Buyer will be asked to transfer the payment once all the points of the transaction are agreed on by both parties. The payments are net of the sending and receiving costs. To check the amount to be sent we advise you to open the transaction page and refer to the main entry &quot;Total debit&quot;.</strong></span></span></p>\r\n', '2013-09-11'),
(10, 'Financial Question', 'When will the payment be charged to my credit card?', '<p>\r\n	<span style="color:#b22222;"><span style="font-size: 12px;"><strong>The payment will be charged to the Buyer&#39;s credit card when he/she send a fax with the details required to confirm the payment. When the Buyer receives the monthly bank account statement, it will show that SafeDeal had cashed the payment (please take note that SafeDeal has to receive the payment from the Buyer before asking the Seller to send the goods).</strong></span></span></p>\r\n', '2013-09-11');
