(1, '.:: Welcome to Transmith Group ::.', 'We transport everything from critical parts to keep an assembly line running, to crucial time-sensitive documents. Our personalized service offers hands-on monitoring, web-based tracking and guaranteed on-time delivery for your most impossible deadlines. \r\nOur ever-expanding array of customized services means that Transmith has the shipping solution to meet all your needs.', 'International Cargo Transport Service, shipping,escrow,tranrun,cts,limited,domestic shipping,Delivery Payment,');
INSERT INTO `site_logo` (`id`, `photo`) VALUES
(1, 'ddd.gif');
INSERT INTO `term_condition` (`id`, `title`, `descr`, `post_date`) VALUES
(1, 'Identification and assessment of the Client', '<p>\r\n	<font color="#336699" face="Arial,Helvetica,Geneva,Swiss,SunSans-Regular" size="2"><b>The information supplied by the Client in SafeDeal&#39;s registration page have to be true and accurate. The Client must not contact people, associations, corporations, or use an alias if not authorised to do so by SafeDeal. If any of the information is proved to be false or incorrect, SafeDeal retains the right to cancel the transaction. The Clients must update the information as required by the Service contract. </b></font></p>\r\n', '2013-07-26'),
(2, 'The Client''s Conduct', '<p>\r\n	<font color="#336699" face="Arial,Helvetica,Geneva,Swiss,SunSans-Regular" size="2"><b>Our services are available only to those who can act in their full capacity, as intended and desired by law (Civil Code art. 2), that is the capacity to conclude contracts and sales. </b> </font></p>\r\n<p>\r\n	<font color="#336699" face="Arial,Helvetica,Geneva,Swiss,SunSans-Regular" size="2"><b>The Clients agree that their transactions do not violate any State Laws. In particular the service cannot assist transactions that provide for:</b> </font> <font color="#cc0000" face="Arial,Helvetica,Geneva,Swiss,SunSans-Regular" size="2"><br />\r\n	<b> </b> </font></p>\r\n<p>\r\n	<font color="#cc0000" face="Arial,Helvetica,Geneva,Swiss,SunSans-Regular" size="2"><b>1) goods that incite racial, xenophobic, or anti-Semitic hatrid or violence;<br />\r\n	2) goods that can damage the security and integrity of a State, whichever it may be;<br />\r\n	3) arms or ammunition;<br />\r\n	4) animals, of which the importation, exportation, commerce or possession are not allowed by law or bylaws;<br />\r\n	5) human organs;<br />\r\n	6) drugs and narcotic substances;<br />\r\n	7) cigarettes and tobacco products;<br />\r\n	8) alcohol produced without the proper authorization as required by law and bylaws;<br />\r\n	9) MP3 files;<br />\r\n	10) counterfeit goods in violation with the national and international laws that safeguard industrial and intellectual property;<br />\r\n	11) goods of any type which the selling of is illegal or not allowed by national or international bylaws.<br />\r\n	</b> </font></p>\r\n<p>\r\n	<font color="#cc0000" face="Arial,Helvetica,Geneva,Swiss,SunSans-Regular" size="2"><i><b>This list should be considered indicative and not limiting.</b> </i> </font></p>\r\n<p>\r\n	<font color="#336699" face="Arial,Helvetica,Geneva,Swiss,SunSans-Regular" size="2"><b>The Clients that use the Service are subject to all bylaws and state laws, national and international, with particular reference, but not limited to, the networks that have the Service or a transmission of its data. The Clients must not transmit any offensive or illicit material. </b> </font></p>\r\n<p>\r\n	<font color="#336699" face="Arial,Helvetica,Geneva,Swiss,SunSans-Regular" size="2"><b>The Clients must undertake to obtain and mantain a telephone service, needed to access and use the Service. The Clients are responsible for any changes connected to the Service.</b> </font></p>\r\n<p>\r\n	<font color="#336699" face="Arial,Helvetica,Geneva,Swiss,SunSans-Regular" size="2"><b>The Clients are the only ones responsible for the contents of their transmission, and they will not interfear or tamper with networks connected to the Service. </b> </font></p>\r\n<p>\r\n	<font color="#336699" face="Arial,Helvetica,Geneva,Swiss,SunSans-Regular" size="2"><b>The Clients are aware that any attempts to violate or access other computers are prohibited. </b> </font></p>\r\n<p>\r\n	<font color="#336699" face="Arial,Helvetica,Geneva,Swiss,SunSans-Regular" size="2"><b>SafeDeal can, at its own discretion, terminate the Service immediately if the Client&#39;s conduct does not respect the contract. </b> </font></p>\r\n', '2013-07-26'),
(3, 'Cancellation', '<p>\r\n	<font color="#336699" face="Arial,Helvetica,Geneva,Swiss,SunSans-Regular" size="2"><b>SafeDeal reserves the right to cancel any transaction after 15 days from its start date if, by such a date, the Buyer or Seller have not arrived at an agreement on the transaction details. </b></font></p>\r\n', '2013-07-26'),
(4, 'Service Restrictions', '<p>\r\n	<font color="#336699" face="Arial,Helvetica,Geneva,Swiss,SunSans-Regular" size="2"><b>SafeDeal is not responsible for the transfer of private and personal documents. SafeDeal is not responsible and will not give a testimonial verifying the property and ownership of the goods in the transaction. </b></font></p>\r\n', '2013-07-26'),
(5, 'Client Account, Password and Security', '<p>\r\n	<font color="#336699" face="Arial,Helvetica,Geneva,Swiss,SunSans-Regular" size="2"><b>The Clients alone are responsible for the confidentiality of their own passwords and for each and all of their activities that originate from their accounts. The Clients must immediately notify SafeDeal of any unauthorised use, or breach of privacy, confidentiality and security of their client accounts. </b> </font></p>\r\n<p>\r\n	<font color="#336699" face="Arial,Helvetica,Geneva,Swiss,SunSans-Regular" size="2"><b>The e-mail received from our service is simply for information, you should visit the transaction page on the web site to check the progress of your transaction.</b> </font></p>\r\n<p>\r\n	<font color="#336699" face="Arial,Helvetica,Geneva,Swiss,SunSans-Regular" size="2"><b>For security reasons SafeDeal will not send e-mails containing postal addresses. Send to the address which is shown on your transaction page. Other methods of obtaining addresses are not recognised by SafeDeal</b> </font></p>\r\n', '2013-09-11'),
(6, 'Mailing Requirements', '<p>\r\n	<font color="#336699" face="Arial,Helvetica,Geneva,Swiss,SunSans-Regular" size="2"><b>The Seller has to send the goods directly to the Buyer&#39;s address. DO NOT SEND THE GOODS TO SafeDeal. The goods sent to SafeDeal will be returned to the sender at the sender&#39;s expense. The Seller is responsible for the goods until the moment the Buyer receives them. We advise the Seller to insure the goods for the entire value of the selling price. SafeDeal is not responsible for the loss or damage of the goods mailed. </b> </font></p>\r\n<p>\r\n	<font color="#336699" face="Arial,Helvetica,Geneva,Swiss,SunSans-Regular" size="2"><b>The Seller has to use a transport and postal service that gives a tracking number or a reference number which allow SafeDeal to confirm, directly with the courier company&#39;s web site, the dispatching of the goods, we would like to remind you that for any international and national shipment the courier&#39;s web site must show both shipment and delivery. The Clients authorise SafeDeal to use the information from the tracking number to confirm the consignment of the goods. The Client&#39;s signature, and/or that of his/her agent or appointee, on the consignment receipt is the only valid proof that the goods have been sent and received. </b> </font></p>\r\n<p>\r\n	<font color="#336699" face="Arial,Helvetica,Geneva,Swiss,SunSans-Regular" size="2"><b>If the Seller does not send the goods within 15 days of the negotiation status, which indicates </b> </font> <font color="#cc0000" face="Arial,Helvetica,Geneva,Swiss,SunSans-Regular" size="2"> <i> <b> &quot;the Buyer has paid&quot;</b> </i> </font> <font color="#336699" face="Arial,Helvetica,Geneva,Swiss,SunSans-Regular" size="2"> <b> , SafeDeal reserves the right to refund the sum to the Buyer, withdrawing SafeDeal&#39;s payment, and cancelling the transaction. </b> </font></p>\r\n<p>\r\n	<font color="#336699" face="Arial,Helvetica,Geneva,Swiss,SunSans-Regular" size="2"><b>Even if SafeDeal is able to know, via the traking number or reference number on the consignment receipt, when the goods were delivered, SafeDeal will only pay after the Buyer approves the acquisition and after the Inspecton Period is completed, whichever is the first to be ascertained. The Inspection Period is the time allowed, agreed on by the Buyer and the Seller, to examine and value the goods. The Inspecton Period begins at 12:01 on the working day (Monday - Friday) after the goods have been delivered, and finishes after the number of working days established by the Buyer and Seller are completed. The delivery day is considered to be that which is indicated on the consignment receipt of the transport and/or postal service. </b> </font></p>\r\n<p>\r\n	<font color="#336699" face="Arial,Helvetica,Geneva,Swiss,SunSans-Regular" size="2"><b>If SafeDeal is not able to ascertain when the Buyer had received the goods, SafeDeal reserves the right to cancel the transaction and refund the net sum, after the deduction of SafeDeal&#39;s fee, to the Buyer. </b> </font></p>\r\n<p>\r\n	<font color="#336699" face="Arial,Helvetica,Geneva,Swiss,SunSans-Regular" size="2"><b>The Clients agree that SafeDeal is not responsible for the restitution of the goods, or for any disputes between the Buyer and Seller after the transaction has been completed. The transaction is considered completed after the entire balance of the goods is paid. </b> </font></p>\r\n<p>\r\n	<font color="#336699" face="Arial,Helvetica,Geneva,Swiss,SunSans-Regular" size="2"><b>If the goods require a particular type of transport, clearance, liscence and insurance, an international transport and postal service, to SafeDeal&#39;s approval, must be used. The transport and postal service has to be able to suply SafeDeal with proof of the dispatching of the goods. </b> </font></p>\r\n', '2013-07-26'),
(7, 'Consignment Request', '<p>\r\n	<font color="#336699" face="Arial,Helvetica,Geneva,Swiss,SunSans-Regular" size="2"><b>The Buyer will give SafeDeal complete and accurate information on the address where the goods are to be sent and will notify SafeDeal immediately of any changes of address. Any incorrect information the Buyer gives is to be retained entirely the Buyer&#39;s responsability. The Buyer is also retained responsible for ensuring that he/she or his/her appointee is available to receive or collect the goods promptly from the courier. The Buyer is responsible for informing SafeDeal, within the Inspection Period, any different consignment information given to the transport and postal service. If the goods are insured and are damaged during the mailing or transport, the Buyer has to immediately inform the parties interested: SafeDeal, the Seller and the courier service. The Insurance company will directly contact the Buyer regarding any action to be undertaken. If the goods are damaged during the transport or mailing, the Buyer has to keep both the packaging and the goods for assessment by the insurance company. If the Seller has not insured the goods, he/she is responsible for their repair or refund. The Buyer is responsible for any damages which occur after the consignment. </b> </font></p>\r\n<p>\r\n	<font color="#336699" face="Arial,Helvetica,Geneva,Swiss,SunSans-Regular" size="2"><b>If the Buyer returns the goods to the Seller, the Buyer is responsible for all the conditions of transport and the Seller is responsible for the consignment conditions as described in this contract. </b> </font></p>\r\n', '2013-07-26'),
(8, 'Financial Deposit', '<p>\r\n	<font color="#336699" face="Arial,Helvetica,Geneva,Swiss,SunSans-Regular" size="2"><b>SafeDeal will accept the following ways of payment: (1) credit cards ( VISA, MASTERCARD); (2) bill of exchange; (3) banker&#39;s draft; (4) bank transfer. If the payment is made by credit card, the Client must be the credit card holder. All payments are to be made to SafeDeal</b></font></p>\r\n', '2013-07-26'),
(9, 'Fee and Responsability', '<p>\r\n	<font color="#336699" face="Arial,Helvetica,Geneva,Swiss,SunSans-Regular" size="2"><b>After the payment is received, SafeDeal&#39;s service fee is non refundable.</b></font></p>\r\n', '2013-07-26'),
(10, 'Requests or Refunding of Capital', '<p>\r\n	<font color="#336699" face="Arial,Helvetica,Geneva,Swiss,SunSans-Regular" size="2"><b>The sum of the value, taken in faith, cannot be returned without: (1) the consent of both the contracting parties; (2) if the transaction is executed or fulfilled outside the Service Rules.</b></font></p>\r\n', '2013-07-26'),
(11, 'Copies of Documents', '<p>\r\n	<font color="#336699" face="Arial,Helvetica,Geneva,Swiss,SunSans-Regular" size="2"><b>The Clients should make copies of every document necessary for their dossier, including also, SafeDeal&#39;s instructions, receipts and agreements. SafeDeal will not send copies of documents unless specifically requested by the Client. </b></font></p>\r\n', '2013-07-26'),
(12, 'Disclosure', '<p>\r\n	<font color="#336699" face="Arial,Helvetica,Geneva,Swiss,SunSans-Regular" size="2"><b>All the information required in the registration page is considered to be &quot;Registration Data&quot;. The data collected by SafeDeal, regarding the Client&#39;s use of the Service, is considered to be &quot;Use of the Service&quot;. The Clients allow SafeDeal to reveal the &quot;Registration Data&quot; and &quot;Use of Service&quot;, this disclosure will exclude the Clients name, address, e-mail, account number, and telephone number. SafeDeal will only reveal all or some of the information if requested by the relevant authorities. </b></font></p>\r\n', '2013-07-26'),
(13, 'Waiver', '<p>\r\n	<font color="#336699" face="Arial,Helvetica,Geneva,Swiss,SunSans-Regular" size="2"><b>No annoncement or information, verbal or written, obtained from the Clients or through the Service, will be an authorisation unless expressly made by SafeDeal. The Clients use this Service at their own risk, subject to this contract. </b> </font></p>\r\n<p>\r\n	<font color="#336699" face="Arial,Helvetica,Geneva,Swiss,SunSans-Regular" size="2"><b>SafeDeal waivers any right of authorisation; for example that to authorise the marketability or the suitability of specific targets. SafeDeal does not guarantee that the Service will satisfy all of the Clients needs or will be uninterupted, safe or free from error. SafeDeal will not give any guarantee of the results obtained from the use of the Service, of their accuracy, reliability, or of defects in the software. </b> </font></p>\r\n', '2013-07-26'),
(14, 'Limit of Responsability', '<p>\r\n	<font color="#336699" face="Arial,Helvetica,Geneva,Swiss,SunSans-Regular" size="2"><b>SafeDeal will not be retained responsible for: direct, indirect, accidental, extraordinary or consequential damages, resulting from the use of or the inability to use the Service; or eventual additional costs or expenses produced by the use of the Service. SafeDeal will not be retained responsible for messages received or admission to transactions through the Service, resulting in an unauthorised access, or changes in the Client&#39;s transmission or data, including but not only, damages for the lack of profit, use, data or other intangible property, even if SafeDeal had been informed of such damages. SafeDeal cannot be responsible to the Client for more than the amount paid by the Client to the Service. SafeDeal will not be retained responsible for any agreement, neither written nor verbal, between Clients, which had not been brought to SafeDeal&#39;s attention. </b></font></p>\r\n', '2013-09-11'),
(15, 'Resale or Commercial Use of the Service', '<p>\r\n	<font color="#336699" face="Arial,Helvetica,Geneva,Swiss,SunSans-Regular" size="2"><b>The right to use the Service is reserved to Clients only. The Clients agree to not resell or use the Service commercially without the permission of SafeDeal. The Clients are aware that the contents published in the Service can be protected by copyright, trade-marks, or other property or rights. The Clients accept that without SafeDeal&#39;s consent, they cannot resell the Service to others, use the Service for the transmission of or receive replies for commercial incentives. The Clients concur to not, for commercial purposes, adjourn, transmit, reproduce, distribute, or participate in a transmission or a sale, or by other means profit from any of the Service&#39;s contents. The Clients accede to not use the SafeDeal Service for transmissions or receiving mail of any type. The Clients agree to not use the Service&#39;s ample quantity of addresses to divulge a message without the written consent of SafeDeal. The Clients undertake to not falsify communications transmitted through the Service. The Clients acccede to not permit third parties to transmit communications that falsify the identity of their account as the origin of such a communication.</b></font></p>\r\n', '2013-07-26'),
(16, 'Participation in Advertising Publicity', '<p>\r\n	<font color="#336699" face="Arial,Helvetica,Geneva,Swiss,SunSans-Regular" size="2"><b>The Clients consent SafeDeal to send them, electronically or by aother means chosen by SafeDeal, information including advertisements, communications and solicitations. The Clients recognise that the advertisements and solicitations are an inseparable part of the Service&#39;s activity. The Clients understand and accept that such advertisements and solicitations cannot cease until the Service is discontinued. The Clients can correspond with or participate in promotions with the advertisers that are showing the Service&#39;s products; each correspondence, promation, mailing, payment of goods or services, or any other terms, conditions or authorisations that are associated with them are established between the Client and the advertiser. SafeDeal does not assume any responsibilty or obligation of any kind for such correspondence or promotion. The Clients agree to pay all the sales, use, duties or trade taxes of goods and services that the Clients have acquired through the SafeDeal Service.</b></font></p>\r\n', '2013-07-26'),
(17, 'Amendments and Modifications of the Service Rules', '<p>\r\n	<font color="#336699" face="Arial,Helvetica,Geneva,Swiss,SunSans-Regular" size="2"><b>SafeDeal can amend the contract at any moment and in any way. The Clients should confirm and accede to the changes made by SafeDeal. If the Client does not accept the amendments, he/she should interrupt and terminate the use of the Service.</b></font></p>\r\n', '2013-07-26'),
(18, 'Termination of the Contract', '<p>\r\n	<font color="#336699" face="Arial,Helvetica,Geneva,Swiss,SunSans-Regular" size="2"><b>SafeDeal can, at its own discretion, terminate the Service if the Client does not conform to the contract, or if the Client wants to change or modify the Service contract. </b> </font></p>\r\n<p>\r\n	<font color="#336699" face="Arial,Helvetica,Geneva,Swiss,SunSans-Regular" size="2"><b>SafeDeal reserves the right to modify and interrupt the Service, giving or not giving notice to the Clients and, exercising this right, SafeDeal will not be held responsible for the Clients or any third parties. Both the Client and SafeDeal can , at any moment in time, with or without a reason, decide to cease the use of and access to the Service and personal account. </b> </font></p>\r\n', '2013-07-26');
INSERT INTO `testimonial` (`id`, `name`, `descr`, `post_date`) VALUES
(1, 'CHANDRA , JAPAN  | MOTORHOME', '<blockquote style="margin: 0px 150px 8px 0px; padding: 3px 0px 0px 24px; border: 0px; font-size: 13px; vertical-align: baseline; font-family: Arial, Helvetica, sans-serif; line-height: 1.3em; background-image: url(https://escrow.com/images/quote_open.gif); color: rgb(0, 0, 0); background-position: 0px 0px; background-repeat: no-repeat no-repeat;">\r\n	It&#39;s been my 3rd transaction with Transmith Group &nbsp;I&#39;ve always been impressed with your straight forward and secure service. I live in Japan and was amazed by your speed in sending payment through wire transfer. I receiving the closing statement by email and within a few hours, my banker in Japan called me to let me know the funds are in my account here in Japan. Wow I can&#39;t believe how fast you guys are. Even my buyers payment from Europe was received quickly and the transaction status was updated within 3 days so we could proceed fast towards inspection without delays. I&#39;ll be sure to recommend&nbsp;Transmith Group&nbsp;to colleagues. You guys never fail! Thank you very much for your excellent service.</blockquote>\r\n<p>\r\n	&nbsp;</p>\r\n', '2013-09-09'),
(3, 'MITCHELL , TEXAS | VEHICLE', '<blockquote style="margin: 0px 150px 8px 0px; padding: 3px 0px 0px 24px; border: 0px; font-size: 13px; vertical-align: baseline; font-family: Arial, Helvetica, sans-serif; line-height: 1.3em; background-image: url(https://escrow.com/images/quote_open.gif); color: rgb(0, 0, 0); background-position: 0px 0px; background-repeat: no-repeat no-repeat;">\r\n	I found your service to be extremely easy-to-use and extremely helpful. Prior to finding your website online I was unable to make arrangements to make a contingency payment through my bank or any other institution that I found. Thank you very much for your service. I will highly recommend it to everyone else I deal with in purchasing vehicles on line.</blockquote>\r\n', '2013-09-09'),
(2, 'THOMAS , GERMANY  | BOAT', '<p>\r\n	<span style="color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; font-size: 13px; line-height: 16.890625px;">This was the first time I was involved in this type of transaction and escrow.com made it very easy from start to finish. The communication from you was great and I did not have any problems at all. I will definitely use your services in the future and also recommend your company to others. Thank you for such a smooth process.</span></p>\r\n', '2013-09-09'),
(4, 'HANNAH , AUSTRALIA | VEHICLE SELLER', '<blockquote style="margin: 0px 150px 8px 0px; padding: 3px 0px 0px 24px; border: 0px; font-size: 13px; vertical-align: baseline; font-family: Arial, Helvetica, sans-serif; line-height: 1.3em; background-image: url(https://escrow.com/images/quote_open.gif); color: rgb(0, 0, 0); background-position: 0px 0px; background-repeat: no-repeat no-repeat;">\r\n	&nbsp;It was a great experience. Katie was fantastic. They worked very promptly to pay off my lien and pay me. Gave the buyer and I both protection of funds/property. I&#39;m very pleased and will definitely recommend Transmith Group Limited &nbsp;to friends and family.</blockquote>\r\n<p>\r\n	&nbsp;</p>\r\n', '2013-09-09'),
(5, 'ALVAREZ ,SPAIN | LAMP', '<p>\r\n	<span style="color: rgb(153, 153, 153); font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 11px; line-height: 14px;">You were all so helpful &nbsp;I can not thank you enough for your support. The packages arrived safely. The packaging was professional and my beautiful new bullseye lamp is in perfect condition</span></p>\r\n', '2013-09-09'),
(6, 'JOE, ILLINOIS | MICROSCOPE', '<p>\r\n	<span style="color: rgb(153, 153, 153); font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 11px; line-height: 14px;">Just a note to thank you and your packer for the excellent job in shipping the large Pillischer microscope and its glass case and slide case to me in America. Everything was done perfectly and all arrived without any new problems. It appeared that your packer used the suggestions I&#39;d emailed you and I was most impressed with the care and expertise in packing of these difficult items. I&#39;d certainly seen your advertisements in antique periodicals many times, and I do import regularly from UK, but I think this was the first occasion that I&#39;ve dealt with you. I also felt your price was quite reasonable and look forward to using your services again in the future.&quot;</span></p>\r\n', '2013-09-09'),
(7, 'GIANLUCA,ITALY |  MIRROR', '<p>\r\n	<span style="color: rgb(153, 153, 102); font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 11px; line-height: 15px;">My Regency Mirror, which was very fragile, arrived with not a single problem. Your driver was both courteous and accommodating and single-handedly put it on the first floor landing for me with no complaint. Goods - however fragile - are SAFE in your good hands</span></p>\r\n', '2013-09-09'),
(8, 'MIGUEL , ARGENTINA | TRACTOR', '<p>\r\n	<span style="color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; font-size: 13px; line-height: 16.890625px;">Transmith Group made the ownership transfer transaction happen with ease. What an exceptional escrow service! Phenomenal user interface, exceptional transparency and real-time status / history insight. A true &ldquo;WOW&rdquo; experience with an exceptional service on a near-perfection web interface. Thank you so much!</span></p>\r\n', '2013-09-09'),
(9, 'IGOR , RUSSIA | ROLEX', '<p>\r\n	<span style="color: rgb(0, 0, 0); font-family: Georgia, ''Times New Roman'', serif; font-size: 13px; line-height: 21px; background-color: rgb(255, 247, 219);">I can&rsquo;t say enough good things about the service, integrity and dedication that Transmith Group SafeDeal escrow services shows for their clients. In all of my years in working with them, which is now almost 3, I have never encountered a problem with my escrow they couldn&rsquo;t handle. I would highly recommend their services to anyone looking for a smooth escrow.</span></p>\r\n', '2013-09-09');
